import React from 'react';

const Table = () => {

    const data = [
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ],
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ],
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ],
        [
            'cell1', 'cell2', 'cell3', 'cell4'
        ]
    ];

    return (
        <table>
            <tr>
                <td>{data[0, 0]}</td>
                <td>{data[0, 1]}</td>
                <td>{data[0, 2]}</td>
                <td>{data[0, 3]}</td>
            </tr>
            <tr>
                {data[1]}
            </tr>
            <tr>
                {data[2]}
            </tr>
        </table>
    );
};

export default Table;
